import logo from './logo.svg';
import './App.css';
import Login from './component/login';

function App() {
  return (
    <div className="App">
      <ToastContainer theme='colored' position='top-center'></ToastContainer>
      <BrowserRouter>
      <Appheader></Appheader>
      <Routes>
        <Route path='/login' element={<Login/>}></Route>
      </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
